const Logo = (props) => {
   function logWhenClicked() {
    console.log("Button was clicked!");
  }

  return (
    <header>
      <h1>Welcome to {props.appName}</h1>
      <img
        src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/016.png"
        onClick={logWhenClicked}
      />
    </header>
  );
};




export default Logo;
